import { ListItem, List, Container, Typography } from '@mui/material';
import { styled } from '@mui/system';

const UserList = styled(List)({
  border: '1px solid #ccc',
  borderRadius: '5px',
  padding: '10px',
});

const UserListItem = styled(ListItem)({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
});

const UserName = styled(Typography)({
  fontWeight: 'bold',
});

function GroupUsers({ users, user }) {
  console.log(users);

  const renderUsers = users.map((thisUser) => {
    if (user.id === thisUser.id) {
      return null;
    }

    return (
      <Container key={thisUser.id}>
        <UserList>
          <UserListItem>
            <UserName>{thisUser.name}</UserName>
          </UserListItem>
        </UserList>
      </Container>
    );
  });

  return (
    <Container>
      <Typography variant="h5" component="h2">
        Users
      </Typography>
      {renderUsers}
    </Container>
  );
}

export default GroupUsers;
